from datetime import datetime
import collections



class Solution:
    def findSubstring(self, s: str, words) :
        ans = []

        w_set = dict()
        for val in words:
            if val in w_set.keys():
                w_set[val] += 1
            else:
                w_set[val] = 1
        w_count = len(words)
        w_len = len(words[0])
        win = w_len * w_count
        hash_map = [dict() for i in range(w_len)]
        for i in range(len(s) - w_len + 1):
            if s[i:i + w_len] in words:
                k = i % w_len

                if s[i:i + w_len] not in hash_map[k].keys():
                    hash_map[k][s[i:i + w_len]] = [i]
                else:
                    hash_map[k][s[i:i + w_len]].append(i)
        bases_checked = {}
        for k in range(w_len):
            if len(hash_map[k].keys()) == 0:
                continue
            middles = hash_map[k][list(hash_map[k].keys())[0]]
            for middle in middles:
                l_c = min(w_count, middle  // w_len)
                left = middle - (w_len) * l_c
                for base in range(left, min(middle + 1, len(s) - win + 1), w_len):
                    if base in bases_checked: continue
                    bases_checked[base] = 1
                    loop_set = {}
                    for i in range(w_count):
                        if base + i * w_len >= len(s): break


                        if s[base + i * w_len: base + (i + 1) * w_len] in loop_set.keys():
                            loop_set[s[base + i * w_len: base + (i + 1) * w_len]] += 1
                        else:
                            loop_set[s[base + i * w_len: base + (i + 1) * w_len]] = 1

                    if loop_set == w_set and base not in ans:
                        ans.append(base)


        return ans


